INSERT INTO `main_announcement` VALUES (2,'Elias Fries - paintings of fungi','The Swedish mycologist <a href=\"http://www.nrm.se/kbo/saml/fries/tavla.html.en\">Elias Fries</a> (1794-1878) initiated and supervised the production of a large number of paintings of fungi. Several artists were involved in the project and 1,640 taxa were depicted. Some of the plates were published in <a href=\"http://www.nrm.se/kbo/saml/fries/sveriges.html.en\">Sveriges ätliga och giftiga svampar</a> (Edible and poisonous fungi of Sweden, 1860-1868) and <a href=\"http://www.nrm.se/kbo/saml/fries/icones.html.en\">Icones selectae hymenomycetum</a> (1867-1884). Many of the original water colour paintings are kept at the Swedish Museum of Natural History. Here is a small selection of these pictures.\r\n\r\n','','2008-08-20 00:38:55','',''),(3,'SOMA - Sonoma County Mycological Associa','Sonoma County is on the California coastline, about 50 miles north of San Francisco. This area is a location of the <a href=\"http://www.parks.sonoma.net/\">famous giant redwoods</a>. This active mycology club has many events and much information available on their website. Take a look for yourself.','','2008-08-20 00:39:33','',''),(4,'DVD of Taylor Lockwood\'s show','Those of you who are familiar with the <a href=\"http://www.fungiphoto.com/\">photography of Taylor Lockwood</a> may have seen his show he has toured with. It\'s a slide show of his photos timed with classical background music. The music and the photos are fitted to each other to make a show with shape and direction. Taylor has now made this show available on DVD for your own viewing. To find out how to get your copy, <a href=\"http://www.fungiphoto.com/Treasury/DVD.html\">go to Taylor\'s web page</a>.','','2008-08-20 00:40:23','',''),(5,'Fungi and Poetry - the Thaxter\'s','Celia Thaxter wrote poetry while her husband Levi and two of their sons, John and Roland , roamed and studied nature.','','2008-08-20 00:40:37','',''),(6,'Optimists Thrilled! - The Morel is Found','A stout crew of 15 - 20 members of the BMC gathered at the Bolton Lime Quarry in Bolton, MA to search for morels. And there it was! Right by the front gate!','','2008-08-20 00:40:53','',''),(7,'Pictures of Pleurotus','The mushroom classes are going well. For pictures of <i>Plerotus ostreatus</i>, go to Google and <a href=\"http://images.google.com/images?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=pleurotus+ostreatus&sa=N&tab=wi\">search on images</a>.','','2008-08-20 00:41:53','',''),(8,'Great find!  Protubera jamaicensis','Dr. Orson Miller has helped identify this gelatinous gastroid species that was collected on November 1, 2003 at the BMC\'s weekend foray on Cape Cod.','','2008-08-20 00:42:17','',''),(9,'Martin Zlotkin - Fungi Photos','I am an artist producing Limited and Custom Edition Prints of Fungi. Take a minute and <a href=\"http://www.land-marks.com/NvPgs/FngNv.html\">see for yourself</a> the kind of imagery, the scope and the richness of execution of my work. The prints are photographically based, digitally manipulated and enhanced. All of the smaller images can be enlarged for more detailed viewing. Currently, I am an artist in residence at Lafayette College, Easton, PA.','','2008-08-20 00:43:08','',''),(10,'Photographer - Darlyne Murawski','The January winter meeting was a wonderful display of photography by professional photographer Darlyne Murawski. Darlyne\'s work can be seen in the National Geographic magazine, where she photographs not only fungi, but other small wonders of the natural world. Take a look at her work online at National Geographic. Her photos are also featured in a National Geographic article about each of us being an ecosystem. Darlyne is a research associate at Harvard University and enjoys photographing small creeping things. National Geographic has published a book of her photos: Bug Faces. But you want to see her photos of fungi - look here. ','','2008-08-20 00:43:30','',''),(11,'Mexican Mushroom Tours - 2004','For Fungi Aficionados with a Taste for the Exotic:  For our 5th year of organizing adventuresome mushrooming excursions in exciting Mexico, we are pleased to announce three different tours for 2004 - each offering unique travel, cultural and, of course, fungi experiences with expert local bilingual mycologists. Since 2000, we have had participants ranging from expert mycologists and mushroom club presidents, to well-versed amateurs, curious beginners and a few chefs and food writers, all ready to try a new outdoors travel experience. As you can see from our Prior Tours pictures and comments, the rewards and good memories have been many and warm.','','2008-08-20 00:43:56','',''),(12,'A Tour of the Farlow','For the February 2004 monthly meeting for the winter program of the Boston Mycological Club, members were treated to a tour of the Farlow Herbarium at Harvard University. Groups of people were shown where the collections were stored, including a few samples from the herbarium. In addition, a tour of one of the labs and a brief talk by a graduate student on their work and how they use the equipment in the lab. Tours ended in the beautiful reading room of the Farlow library. As people were waiting in the meeting room for their turn to tour, there was a presentation running on the slide screen with interesting facts about the Farlow and the people who have worked there. The slides ran a little fast - so click on the link for this story and you can read the slides at your own speed.','','2008-08-20 00:44:07','',''),(13,'2004 Clark Rogerson Foray','Gary Lincoff is Chief Mycologist. Other experts include Dr. Sam Ristich, Dr. Roz Lowen, Sandy Sheine and Leon Shernoff. These great teachers, and other knowledgeable mushroomers make this foray an event where everyone, including novices, can enjoy a constant learning experience. We typically harvest 300 to 350 species, including many choice edibles, from nearby, fungally rich parks, such as the Salmon River State Forest. August 26 - 29 in Moodus, CT.  	\r\n\r\nSusan Stone, a member of the BMC, paints watercolors. Here is a \"portrait\" of an oyster mushroom, and more information about her shows.','','2008-08-20 00:44:25','',''),(14,'Indian Pipe','Monotropa uniflora is often found by mushroomers - but it\'s not a mushroom. It\'s actually in the blueberry family! But this plant has a very interesting relationship with mushrooms . . . read Tom Volk\'s web page for the story. (Thanks to Larry Rapoport for this story.)','','2008-08-20 00:44:47','',''),(15,'North East Mycological Foray (NEMF)','<em>The</em> mushrooming conference for the New England region gets underway September 9 near Lake Winnipesaukee, New Hampshire.','','2008-08-20 00:45:06','',''),(16,'Mushroom Identification Classes','The BMC announces the 2004 fall mushroom ID classes. There are 4 classes scheduled, starting September 20, every Monday evening at 7:00 pm at Harvard University Herbarium near Harvard Square.','','2008-08-20 00:45:19','',''),(17,'Stinkhorns in the Rain','Even in this cool wet fall weather, the stinkhorns flourish in the woods and gardens. On a walk in Lincoln, MA, a beautiful skirted stinkhorn was found in a thicket of bittersweet. Another sharp eye in Beverly, MA found the \"eggs\" of a stinkhorn, cut them open and photographed them.','','2008-08-20 00:45:31','',''),(18,'The Last ID meeting (L. decorosa &tc.)','A few interesting specimens were brought into the last ID meeting of the BMC on November 8. A Leucopholiota decorosa, a lovely orange A. muscaria, and some strange blue mycelium (with a microscope photo of the hyphae and spores.','','2008-08-20 00:45:41','',''),(19,' Guest author, Russ Cohen, signing books','The annual business meeting of the Boston Mycological Club will feature author Russ Cohen, with his book \"Wild Plants I Have Known... and Eaten\". The business portion of the evening will begin at 7:00 pm and Russ\' talk will begin no sooner than 7:30. Copies of his book will be there for purchase.','','2008-08-20 00:45:52','',''),(20,'Wanted - Entoloma abortivum','Dear mushroomers,\r\n\r\nI am a graduate student at Duke University in Rytas Vilgalys\' mycology lab. I first became involved with NAMA during my undergraduate work at La Crosse, Wisconsin with Tom Volk and was impressed with how active NAMA members are in going out and collecting mushrooms and how proficient many are at taxonomy. For my PhD thesis I am interested in deciphering the parasitism that leads to aborted Armillaria (formerly known as aborted Entoloma). However, to do this I need extensive sampling throughout North America so I can track which species of Armillaria are involved in which regions. This is where I hope you might be of assistance! These mushrooms will start appearing over the next few months and I would be most grateful if mushroom hunters would keep an eye out for me and send any specimens they collect. I\'ve attached <a href=\"http://mediabmc.dreamhosters.com/pdf/EntolomaAbortivumWantedPoster.pdf\">a flyer with more information</a> and my contact information.\r\n\r\nThank you so much for your time. This project is not possible without the cooperation and assistance of clubs such as yours and I appreciate these efforts very much.\r\n\r\n-Bernadette O\'Reilly\r\nDuke University Biology\r\nDurham, NC','','2008-08-20 00:47:06','',''),(21,'Spectacular Mushroom Season!','After several lean years, we have mushrooms!  The great season even made the front page of the Boston  Globe.  See: http://www.boston.com/news/local/articles/2008/08/23/everythings_coming_up_mushrooms/','','2008-08-21 16:56:29','',''),(22,'Upcoming Walks',' Saturday, September 20, 10:30 AM\r\n\r\nCollecting Area: Wompatuck State Park, Hingham, MA\r\nMeeting Place: Parking area to left of Admin. Bldg.\r\nDirections: Take Rt. 128/I-95 South to Rt. 3 toward Cape Cod. Exit in Hingham, Rt. 228 (signs to Nantasket). Follow Rt. 228 East/North for about 3.5 miles, to right at Free St. Go about one mile on Free St. to park entrance on right. Follow road to admin./parking area on right. If you wish to collect safe, fresh, spring water, bring containers.\r\n\r\n\r\n  Sunday, September 28, 1:30 PM \r\n\r\nCollecting Area: Marconi Beach, Cape Cod Nat’l Seashore, Wellfleet, MA\r\nMeeting Place: Marconi Site Headquarters\r\nDirections: From Boston: Take Rt. 3 to Sagamore Bridge and on to Rt. 6 which is limited access until you get to the Orleans Rotary (which should take you approximately 40 minutes from the bridge). Take the rotary exit to Eastham and Provincetown. Do not turn off Rt. 6 at National Seashore Visitors Center. Proceed through Eastham toward Wellfleet. Marconi Site light and right turn is 8 miles from the rotary. Follow signs to Headquarters. Via Rt. 495: Use the Bourne Bridge to Rt. 6. This will take you to the entrance to the limited access road. The entrance, to the right, is at a traffic light and is well marked.\r\n\r\n\r\n  Special Weekend! October 10 to October 12, 2008, The BMC will host amateur mycologist Noah Siegel for Sunday walks to be announced, and a Saturday evening talk at the Herbarium at 7:00.  ,PM.  Noah will Join us for the October 11 Purgatory Chasm walk, as well.  \r\n\r\n\r\n  Saturday, October 11, 10:30 AM\r\n\r\nCollecting Area: Purgatory Chasm State Park, Sutton, MA\r\nMeeting Place: The shelter on the hill above the visitor’s center. The mushroom hunting is done in an area of trails among mixed woods -- no climbing necessary. In addition to sorting our collections by the usual taxonomic and morphological criteria, we will draw an evolutionary tree of fungi on large sheets of paper and place representative specimens at the correct positions on the branches of the phylogeny. Some of the relationships may surprise you! This is a repeat of an exercise that got rave reviews.\r\nDirections: Sutton, MA is southeast of Worcester off Rt. 146. Take Mass Pike (I-90) West to Exit 10-A. Follow Rt. 146 South. Follow signs on Rt. 146 to Purgatory Chasm State Park. \r\n\r\n\r\n  Sunday, October 19, 1:30 PM\r\n\r\nCollecting Area: Bay End Farm, 200 Bournedale Road, Bourne, MA\r\nMeeting Place: The parking area in front of the farm stand.\r\nDirections: The walk will be at Bay End Farm, a 250 acre private conservation parcel with mixed pine and oak woods, and will take place at 1:30.\r\nFrom Boston: \r\n*Route 3 South* (Southeast Expressway) towards Cape Cod. \r\nLook for sign “Exit 1 A-B-C Route 6 to 6A Buzzards Bay-Hyannis”. \r\nTake *Exit 1A “Route 6 West Buzzards Bay-Falmouth Right Lane”*. \r\nDrive on Route 6 West for aprox. 3 miles into the Bourne Rotary. \r\nDrive 1/2 way around the rotary and take a right immediately after the Exxon gas station onto “*Head of the Bay Road*”. (look for the brown \"Mass Wildlife\" sign) \r\nDrive for 1 mile, SLOW down, take right onto Bournedale Road -- the entrance is a few tenths of a mile down, on the left. Opposite is Grazing Fields Horse Farm. \r\nFrom west of Boston:\r\nTake Route 495 South to Route 25 East (495 turns into 25) - approx 1 hour. \r\nTake *Exit 3 “Bourne & Hyannis”* \r\nThe off ramp will lead you into a rotary, take a right immediately after the Exxon gas station (look for the brown \"Mass Wildlife\" sign) onto *Head of the Bay Road.* \r\nDrive for 1 mile, SLOW down, take right onto Bournedale Road -- the entrance is a few tenths of a mile down, on the left. Opposite is Grazing Fields Horse Farm. \r\nFrom Rhode Island and points south \r\n*Route 95 *to *Route 195 East t*o* Route 25 East.* \r\nWhile on Route 195 follow signs for “Cape Cod and the Islands”. \r\nTake Exit 22A “Route 25 East Cape Cod”. \r\n(While on the highway Route 25 will end and merge into Route 495) \r\nAfter driving 9 miles take *Exit 3 “Bourne & Hyannis”* \r\nThe off ramp will lead you into a rotary, take a right immediately after the Exxon gas station (look for the brown \"Mass Wildlife\" sign) onto *Head of the Bay Road.* \r\nDrive for 1 mile, SLOW down, take right onto Bournedale Road -- the entrance is a few tenths of a mile down, on the left. Opposite is Grazing Fields Horse Farm. \r\nComing from Craigville:(and other parts of Cape Cod): \r\nTake Rte 6 West until you come to the Cape Cod Canal. Right after crossing the canal on the “flyover,” take the Rte 6 (Scenic Highway) exit towards Buzzards Bay. \r\nMerge onto Rte 6 (Scenic Highway) heading south along the Cape Cod Canal. \r\nAfter about a mile, look for a stoplight and take a right onto Bournedale Road. Stay on Bournedale about 2 miles. \r\nEnter the farm at 200 Bournedale Road. You will be directed to parking near the farmstand.\r\n\r\n\r\n ','','2008-09-05 06:26:49','',''),(29,'PLEASE NOTE Oct. 11 ID Change ','The October 11, 2008 I.D. Session has been moved to Willard Brook.  We will be doing an ad hoc walk at 10:30, to be followed by IDing.\r\n\r\nWillard Brook State Forest\r\n\r\nRte. 119, Ashby & Townsend\r\n978 597-8802\r\n\r\nPark Directions\r\nWillard Brook State Forest is located in north-central Massachusetts.\r\nFrom the northeast: Take Rte. 495 to Littleton; take the Rte.119 Exit. Follow Rte 119 West approx. 21 miles through W. Townsend to the campground on the left\r\nFrom the west: Follow Rte. 2 East to Rte. 31 North in Fitchburg. Follow 31 North through Fitchburg to the Town of Ashby and the intersection with Rte. 119 East. Follow Rte. 119 East approx. .5 miles to the campground entrance on the right.\r\nFrom the east: Rte 2 West to Fitchburg and Rte.13 North. Follow Rte. 13 North to Rte.119 West in West Townsend. Turn left onto Rte. 119. Follow Rte. 119 approximately 4 miles to the park entrance on the left. ','','2008-10-11 22:32:24','',''),(23,'Join us for an ID Session','We will gather informally to look at the mushrooms people bring in, and work on identifying them.  There\'ll be some common, easily identified mushrooms and some which will require using keys and microscope.  ID Committee members will be available to help.\r\n\r\nWe meet at the conference room at the Farlow Herbarium  Seminar Room.\r\nHarvard University\r\n22 Divinity Ave.\r\nCambridge, MA, 02239 \r\n\r\n•	Monday, September 22 at 7:00\r\n•	Saturday, October 4 at 1:30 PM\r\n•	Sunday, October 12, a 1:30 PM\r\n•	Monday, October 27, at 7:00 PM\r\n•	Saturday, November 1 at 1:30 PM\r\n','','2008-09-05 06:29:23','',''),(24,'Fall Beginner\'s Classes Announced!','Mushroom Identification Classes\r\nBoston Mycological Club\r\n\r\nSeptember 22 – October 13, 2008\r\n\r\n7:00 PM\r\n\r\nFour Monday Evenings \r\nin the Harvard Herbaria Conference Room\r\n22 Divinity Ave, Cambridge, MA*\r\n\r\nCurious about those mushrooms you see popping up in woods and yard?  Wondering what all the fuss is, about wild mushrooming?  The Boston Mycological Club will present five lectures on mushroom identification this Fall. They will be held at 7:00 PM on Monday evenings in the Harvard Herbaria Conference Room, 22 Divinity Ave, Cambridge, MA. The schedule is shown below.\r\n\r\nThe Wonderful World of Mushrooms …….........................................September 22\r\nPast BMC President George Davis will give an overview of amateur mushrooming, and an introduction to the various forms of fungi found in our fields and forests.\r\n\r\nPoisonous and Psychotropic Fungi……………………………..…………………………September 29\r\nEllen Neelands, BMC President, will present a slide presentation from the North American Mycological Association.\r\n\r\nEdible Wild Mushrooms …………………………………………………………………………October 6\r\nBMC Members will review some common edible mushrooms in our area, with tips on cooking and preserving them..\r\n\r\nIdentification of New England Boletes ………………………………………………..October 13\r\nNoah Siegel, nationally known award winning photographer and mushroom identifier has been mushrooming for almost twenty years.  He will present and decode the variety and characteristics of the many boletoid fungi found in New England.\r\n\r\n$10 per class, per person, for BMC members, $15 for non-members or $35 for the entire series for BMC members, $50 for non-members.  \r\n\r\nYou may join the BMC at the time of registration.  For a membership application form, click on \"applicaton\" at the right.  Registrations will be received at the door.\r\n\r\n* Note Parking in area is difficult to find.  You may want to go to https://www2.uos.harvard.edu/cgi-bin/permit/purchase.pl  to purchase a parking ticket.\r\n','Mushroom Identification Classes\r\nBoston Mycological Club\r\n\r\nSeptember 22 – October 13, 2008\r\n\r\n7:00 PM\r\n\r\nFour Monday Evenings \r\nin the Harvard Herbaria Conference Room\r\n22 Divinity Ave, Cambridge, MA*\r\n\r\nCurious about those mushrooms you see popping up in woods and yard?  Wondering what all the fuss is, about wild mushrooming?  The Boston Mycological Club will present five lectures on mushroom identification this Fall. They will be held at 7:00 PM on Monday evenings in the Harvard Herbaria Conference Room, 22 Divinity Ave, Cambridge, MA. The schedule is shown below.\r\n\r\nThe Wonderful World of Mushrooms …….........................................September 22\r\nPast BMC President George Davis will give an overview of amateur mushrooming, and an introduction to the various forms of fungi found in our fields and forests.\r\n\r\nPoisonous and Psychotropic Fungi……………………………..…………………………September 29\r\nEllen Neelands, BMC President, will present a slide presentation from the North American Mycological Association.\r\n\r\nEdible Wild Mushrooms …………………………………………………………………………October 6\r\nBMC Members will review some common edible mushrooms in our area, with tips on cooking and preserving them..\r\n\r\nIdentification of New England Boletes ………………………………………………..October 13\r\nNoah Siegel, nationally known award winning photographer and mushroom identifier has been mushrooming for almost twenty years.  He will present and decode the variety and characteristics of the many boletoid fungi found in New England.\r\n\r\n$10 per class, per person, for BMC members, $15 for non-members or $35 for the entire series for BMC members, $50 for non-members.  \r\n\r\nYou may join the BMC at the time of registration.  For a membership application form, click on \"applicaton\" at the right.  Registrations will be received at the door.\r\n\r\n* Note Parking in area is difficult to find.  You may want to go to https://www2.uos.harvard.edu/cgi-bin/permit/purchase.pl  to purchase a parking ticket.\r\n','2008-09-18 06:06:56','',''),(25,'Second Annual Fungus Fair','Brought to us by member Noah Siegel, and central MA mushroomers!\r\n\r\nInterested in mushrooms? The Millers River Environmental Center is putting the fun into fungus with the Second Annual Fungus Fair to be held on Saturday, September 27th from 10am to 4pm at 100 Main St. in Athol, Ma. Respected mycologists from throughout New England will be on hand to share their knowledge. There will be morning and afternoon expeditions into the local woods to identify and collect mushrooms. Regional authorities will give talks throughout the day on topics including beginners mushroom identification, edible and poisonous fungi and all about morels. At lunch time, enjoy a wild mushroom cook-up. \r\n\r\nThe schedule is as follows:\r\n10:00am Welcome\r\n10:15 Morning Forays leave\r\n10:30 Beginners Mushroom Identification, with Noah Siegel\r\n11:30 Edible and Poisonous Mushrooms of Southern New England, with Bill Yule\r\n12:30 Get a taste of some wild fungi at our Mushroom Cook-up\r\n1:00pm Afternoon Forays leave\r\n1:15 Stories of Morel Mania -where and what to watch out for when hunting for morels, with Elinoar Shavit\r\n3:00 Table walk through, discussing the day\'s finds. Prizes for the Finds of the day\r\n\r\nThe event is free to participants. Beginner and experienced mushroomers welcome. Please bring lunch, a collecting basket with paper or wax-paper bags, magnifying glass, small knife, bug spray. For more information and directions visit www.millersriver.net\r\n\r\n','','2008-09-23 12:13:55','',''),(27,'The BMC to host the 2009 NEMF Foray','Sam Ristich Foray 2009\r\n\r\n33nd Annual Northeast Mycological Foray\r\n\r\nSave the Date\r\nBoston Mycological Club sponsors\r\nNortheast Mycological Foray, October 15-18, 2009\r\nEastham, Cape Cod, MA\r\n\r\nFor the first time, NEMF offers beach and boletes in the same weekend. This Foray is an unusual opportunity to discover mushrooms in Cape Cod’s special ecological niche. Fall on the Cape typically yields an abundant harvest. You’re likely to find Laccaria trullisata poking through the sand or Suillus salmonicolor under pitch pine, a tree endemic to the Cape. In the forest, lucky foragers may stumble on the prized Rozites caperata (Gypsy), Boletus edulis, and edible Leccinums.\r\n\r\nFor non-mycological companions, or for a Cape-break, slurp up local oysters at the annual Wellfleet Oyster Festival just down the road from our hotel. Comb the beach for shells, observe shore birds, take in fall’s kaleidoscope, or cruise funky Provincetown. Fish for stripers or go whale-watching.\r\n\r\nRegistration will open in February. For foray details, visit the NEMF 2009 homepage at http://www.nemf.org/files/2009/2009.html. Gene Yetter’s excellent description of Cape mushrooming is posted at http://nemfdata.org/CapeCodbookreview.htm.\r\n','','2009-07-01 05:57:45','',''),(28,'Talk, Free to members!','Platypus, Pademelon, Python and Plenty of Fungi\r\nA slideshow by award winning photographer Noah Siegel, reflecting 4 \r\nmonths of travels through various Australian ecosystems clicking away \r\nat the eye-catching and unusual.  The show features images of \r\nAustralian flora, fauna, and especially fungi.\r\n\r\nOctober 11, 7:30 p.m. at the Farlow.','','2008-10-05 10:12:54','',''),(30,'Parking at the Farlow','While some attenders prefer trolling Oxford Street and Mass. Ave. for parking places, some will find the following easier:\r\n\r\nPARKING AT HARVARD FOR SESSIONS AT THE FARLOW HEBARIUM:\r\n1. The parking lot at 52 Oxford St is conveniently located. However, it is not directly on Oxford. It\'s really a continuation of Everett Street, which crosses Oxford.\r\n2. Parking after 5pm weekdays and on weekends is only $5.\r\n3. You can ONLY park there by purchasing a pass on-line in advance (or by going to the Harvard Parking Office on Blackstone St.). You cannot pay at the parking garage.\r\n4. The website address for ordering the permit is:\r\n       https://www2.uos.harvard.edu/cgi-bin/permit/purchase.pl\r\n5. Also keep in mind that resident parking in Cambridge does not apply on Sundays.\r\n','','2008-10-13 15:06:34','',''),(31,'2009 - a great year for Mushrooms so far','The 2009 walk list has been finalized and mailed to members.  Non-members can email (address given above) for more information.','','2009-07-10 18:26:50','',''),(32,'2009 NEMF Registration Closed!','The response has been spectacular, and there are no more spaces, even for commuter registrants.\r\n\r\nThe Foray committee says:\r\n\r\nThank you for all that you did to help us publicize our NEMF 2009 Foray. Registration exceeded the stated maximum of 200, but by reorganizing the meeting room space and securing additional rooms at the Ocean Park Inn Motel next door to the Sheraton, we have been able to increase the number of registrants to 240. Unfortunately, even after accepting these additional forty registrants, there are still a good number on the waiting list, and we have closed the registration. We will be updating the NEMF 2009 Foray website shortly with more information about the faculty, talks, walks, and workshops. A registration letter with more details about the foray will be mailed to all registrants before October 1. ','','2009-07-18 05:46:13','',''),(33,'Fall Beginner\'s Classes 2009!','Mushroom Identification Classes\r\n\r\nThree Monday evenings in the Harvard Herbaria Conference Room, 22 Divinity Ave, Cambridge, MA \r\n\r\nSeptember 14th, 21st & October 5th at 7:00pm\r\n\r\nCurious about those mushrooms you see popping up in woods and yard?  Wondering what all the fuss is about wild mushrooming?  The Boston Mycological Club will present three lectures on mushroom identification this fall.  The schedule is shown below.  Please feel free to bring a few specimens of fungi that you’d like to show or identify as we may have time after the lectures to look them over.\r\n\r\nThe Wonderful World of Mushrooms……………………………………September 14\r\nPast BMC President George Davis will give an overview of amateur mushrooming, and an introduction to the various forms of fungi found in our fields and forests.\r\n\r\nHow to Know the Gilled Mushrooms…………………………………….September 21\r\nBMC member Noah Siegel will introduce you to all those mushrooms with gills. We will discuss their distinctive macroscopic features and how to identify them step-by-step to family, genus and finally to species.\r\n\r\nBoletes and Polypores……………………………………………………. …...October 5\r\nNotorious mushroom vendor and forager of fungi for local restaurants - Ben Maleson, will present a lecture on boletes and polypores as well as a few other interesting fungi, with a focus on edible, potentially edible, and poisonous species.  Ben promises an exciting and graphic tale of severe Bolete poisoning from his own personal experience (what they mean by \"it won\'t kill you, but you\'ll wish you were dead\").  A Q & A session will follow the lecture.\r\n\r\nFor information on how to register, click \"full story\", or simply show up at a class.','The Wonderful World of Mushrooms……………………………………September 14\r\nPast BMC President George Davis will give an overview of amateur mushrooming, and an introduction to the various forms of fungi found in our fields and forests.\r\n\r\nHow to Know the Gilled Mushrooms…………………………………….September 21\r\nBMC member Noah Siegel will introduce you to all those mushrooms with gills. We will discuss their distinctive macroscopic features and how to identify them step-by-step to family, genus and finally to species.\r\n\r\nBoletes and Polypores……………………………………………………. …...October 5\r\nNotorious mushroom vendor and forager of fungi for local restaurants - Ben Maleson, will present a lecture on boletes and polypores as well as a few other interesting fungi, with a focus on edible, potentially edible, and poisonous species.  Ben promises an exciting and graphic tale of severe Bolete poisoning from his own personal experience (what they mean by \"it won\'t kill you, but you\'ll wish you were dead\").  A Q & A session will follow the lecture.\r\n\r\n$10 per class, per person for BMC members, $15 for non-members. OR $25 for the entire series for BMC members, $40 for non-members.\r\n\r\nTo pre-register, please send the information below with your check payable to: “Boston Mycological Club” to Marcia Jacob 118 Presidents Lane, Quincy MA 02169\r\n------------------------------------------------------------------------------------------------------------\r\n\r\nName: __________________________________________________________________\r\nAddress: _______________________________________________________________\r\nTelephone #________________   Mobile #: ______________________\r\nEmail address: ___________________________________________________________\r\nMember?_______  Joining?_______ ($20 annual dues)  Amount enclosed: __________\r\n\r\nPlease check: ____The Wonderful World of Mushrooms…….September 14\r\n                        ____How to Know the Gilled Mushrooms……..September 21\r\n                        ____Boletes and Polypores…………………….. October 5\r\n\r\n *Note parking may be difficult to find.  To purchase a parking ticket, please visit: https://www2.uos.harvard.edu/cgi-bin/permit/purchase.pl \r\n','2009-09-13 16:25:06','','');
