INSERT INTO `main_newsbit` VALUES (1,'2003-11-10 00:47:33','the last weekly meeting of the season will be Monday, November 10. Then the winter program starts on December 1.'),(2,'2003-05-12 00:47:48','Winter Bulletin and Winter Program have been mailed out to all members - bulk rate postage.'),(3,'2004-03-18 00:48:13','the March Bulletin is mailed. Look for the membership renewal. '),(4,'2004-04-05 00:48:28','Next winter program lecture: \"Mosses and Liverworts\". Sue Williams studies what we fungiteers step over and around: the mosses and liverworts. We might learn enough from Sue to encourage us to take a second look at these soft, bright green patches on the ground. '),(5,'2004-04-26 00:48:43','Annual Business Meeting of the BMC. To see the club\'s by-laws, <a href=\"bmc_bylaws.html/\">click here</a>. '),(6,'2004-05-22 00:49:27','Spring Culinary Meeting - Check your March Bulletin for details. It\'s on a Saturday evening this year. '),(7,'2004-06-30 00:49:41','the Walk Schedule has been mailed to the current members of the BMC. '),(8,'2004-08-30 00:49:59','mailing sent out containing: Bulletin, Banquet notice, ID class, 2004 club Roster.'),(9,'2004-09-06 00:50:16','no meeting on Labor Day Monday. '),(10,'2004-10-01 00:50:30','Last ID meetings of the season will be on November 1 and 8.'),(11,'2005-04-25 00:50:52','Annual Business Meeting and guest author, Russ Cohen.'),(12,'2005-05-07 00:51:12','Spring Culinary. 6:00 pm. Bring a potluck mushroom dish and a list of its ingredients! '),(14,'2008-09-05 06:20:12','Today marks the beginning of our experiment with posting walks publicly.  '),(15,'2008-10-19 12:00:00','Walk!  1:30 PM\r\n\r\nBay End Farm, 200 Bournedale Road, Bourne, MA\r\nat the parking area in front of the farm stand.'),(22,'2009-04-21 15:20:02','We are leaving last year\'s walk schedule posted, in case you are interested.  The 2009 walk schedule will be ready by early June, and start shortly after July 4th.  '),(17,'2008-10-11 09:58:18','Walk!\r\n10:30 AM\r\n\r\nPurgatory Chasm State Park, Sutton, MA\r\nMeet at the shelter on the hill above the visitor’s center.'),(18,'2008-10-06 10:00:02','Beginner\'s Class: Edible Wild Mushrooms,\r\nMore information at right'),(19,'2008-10-13 10:01:00','Identification of New England Boletes with\r\nNoah Siegel.  More information at right.'),(20,'2008-10-11 10:02:41','Special ID weekend for members with Noah Siegel.  Email for more information.'),(21,'2008-10-11 10:12:22','Platypus, Pademelon, Python and Plenty of Fungi\r\nA slideshow by award winning photographer Noah Siegel'),(23,'2009-07-01 18:26:50','The 2009 walk list went out with the June bulletin, and should be in members hands by now.'),(24,'2009-09-13 16:25:06','Yes, we have a full schedule for fall 2009!  We mail the walk list to members, only.');
